import React from 'react';
import { useLocation } from 'react-router-dom';  // Import useLocation from react-router-dom

function PaymentPage() {
    const location = useLocation();  // Access the location object to get the state data
    const { certName } = location.state || {};  // Extract certName from the passed state

    return (
        <div style={{ padding: '20px' }}>
            <h1 style={{ textAlign: 'center' }}>Payment Page</h1>
            {certName && (
                <p style={{ textAlign: 'center', fontSize: '18px' }}>
                    You are applying for the certification: <strong>{certName}</strong>
                </p>
            )}
            {/* Payment Gateway Integration */}
            <div style={{ textAlign: 'center', marginTop: '20px' }}>
                <button
                    style={{
                        padding: '10px 20px',
                        fontSize: '18px',
                        backgroundColor: '#007BFF',
                        color: 'white',
                        borderRadius: '5px',
                        cursor: 'pointer'
                    }}
                    onClick={() => alert('Proceeding to payment...')}
                >
                    Proceed to Payment
                </button>
            </div>
        </div>
    );
}

export default PaymentPage;
